import Link from 'next/link';

function HomePage() {
  return (
    <nav>
      <h3>Rewardly</h3>
      <Link href="/login">
        <a>Login</a>
      </Link>
      <Link href="/signup">
        <a>Signup</a>
      </Link>
    </nav>
  )
}

export default HomePage;
